import { useContext } from "react"
import { dataContext } from "../ReactProject"
import { Container } from "react-bootstrap"
function GalleryCom() {
    const context = useContext(dataContext)
    return 
        <Container>
            <h2>{context.gallery.title}</h2>
            {
                context.gallery.galleryData.map((item, i) => {
                    return <div key={i} >
                        <img src={item.imgUrl} />
                        <div>
                            <h3>{item.details}</h3>
                        </div>
                    </div>
                })
            }
        </Container>

   
}
export default GalleryCom
